import 'package:flutter/material.dart';

class ScreenTicket extends StatefulWidget {
  @override
  _ScreenTicketState createState() => _ScreenTicketState();
}

class _ScreenTicketState extends State<ScreenTicket> {
  final List<Movie> movies = [
    Movie(
      imageUrl: URL_IMAGEN_1,
      title: 'Valle De Sombras',
      description: 'Descripción de la película 1',
      price: 10.99, 
    ),
    Movie(
      imageUrl: URL_IMAGEN_2,
      title: 'Guardianes De La Noche',
      description: 'Descripción de la película 2',
      price: 12.99, 
    ),
    Movie(
      imageUrl: URL_IMAGEN_3,
      title: 'Planeta De Los Simios',
      description: 'Descripción de la película 3',
      price: 10.99, 
    ),
    Movie(
      imageUrl: URL_IMAGEN_4,
      title: 'Madame Web',
      description: 'Descripción de la película 4',
      price: 11.99, 
    ),
  ];

  // Índice de la película seleccionada
  int? selectedMovieIndex;

  // Variable para almacenar el precio de la película seleccionada
  double? selectedMoviePrice;

  @override
  Widget build(BuildContext context) {
    return ListView.builder(
      itemCount: movies.length,
      itemBuilder: (context, index) {
        final movie = movies[index];
        return Padding(
          padding: const EdgeInsets.all(8.0),
          child: Row(
            crossAxisAlignment: CrossAxisAlignment.start,
            children: [
              SizedBox(
                width: 200, // Ancho de la imagen 
                height: 250, // Alto de la imagen
                child: Image.network(
                  movie.imageUrl,
                  fit: BoxFit.cover, // Ajustar la imagen para cubrir el espacio
                ),
              ), // Imagen de la película
              const SizedBox(width: 16), // Espacio entre la imagen y el contenido
              Expanded(
                child: Column(
                  crossAxisAlignment: CrossAxisAlignment.start,
                  children: [
                    const SizedBox(height: 8), // Espacio entre la imagen y el título
                    Text(
                      movie.title,
                      style: const TextStyle(fontWeight: FontWeight.bold),
                    ), // Título de la película
                    const SizedBox(height: 4), // Espacio entre el título y la descripción
                    Text(movie.description), // Descripción de la película
                    const SizedBox(height: 4), // Espacio entre la descripción y el precio
                    Text(
                      '\$${movie.price.toStringAsFixed(2)}', // Mostrar el precio con formato
                      style: const TextStyle(fontWeight: FontWeight.bold),
                    ), // Precio de la película
                  ],
                ),
              ),
              Radio<int>(
                value: index, // Valor del radio
                groupValue: selectedMovieIndex, // Valor del grupo de radio
                onChanged: (value) {
                  setState(() {
                    selectedMovieIndex = value; // Seleccionar la película actual
                    selectedMoviePrice = movie.price; // Guardar el precio de la película seleccionada
                  });
                },
              ),
            ],
          ),
        );
      },
    );
  }
}

class Movie {
  final String imageUrl;
  final String title;
  final String description;
  final double price; 

  Movie({
    required this.imageUrl,
    required this.title,
    required this.description,
    required this.price,
  });
}



